    TID_TUT_HINT_HYDRO: "Mover uma nave custa hidrogênio. fique de olho na sua reserva de hidrogênio e garanta que sempre haja mineradoras coletando hidrogênio de campos de asteroides.",
    TID_TUT_HINT_KEEPSHIPPING: "Você pode continuar a entregar carregamentos para ganhar renda enquanto seu encouraçado está viajando.",
    TID_TUT_HINT_REPAIR: "Qualquer nave danificada se conserta aos poucos quando ancorada em um planeta colonizado, uma lua ou estação.",
    TID_TUT_PLANETS_WITH_ARTIFACTS: "Planetas próximos a estrelas vermelhas têm artefatos que podem ser pesquisados. diferente de carregamentos comuns, os artefatos levam um tempo para serem colocados nos cargueiros.",
    TID_TUT_HINT_RESEARCH_STATION: "A estação de pesquisa pode armazenar, pesquisar ou reciclar qualquer artefato que você resgatar.",
    TID_TUT_RETURN_HOME: "• retorne para sua estrela de origem",
    TID_TUT_ASK_FOR_NOTIFICATIONS_TITLE: "Notificações",
    TID_TUT_ASK_FOR_NOTIFICATIONS_APPLE: "O hades' star pode enviar notificações de eventos importantes, como quando suas naves mineradoras precisarem de novas ordens.\\n\\nse deseja habilitar essas notificações, acesse as configurações do seu celular.",
    TID_TUT_SHIPYARD_HINT: "O estaleiros permite a construção de novas naves. ele pode ser melhorado para aumentar a capacidade total da sua frota.",
    TID_TUT_UPGRADE_SHIPYARD: "Melhore o seu estaleiro",
