    TID_TUT_INSTALL_MODULE: "Instale um módulo",
    TID_TUT_INSTALL_MODULE_DESCR: "Naves podem ser melhoradas com a instalação de módulos. módulos podem ser ativos ou passivos, e eles fornecem vantagens específicas para cada nave.",
